import React from "react";
import { Link } from "@nextui-org/react";
import { Navbar, NavbarBrand } from "@nextui-org/react";

const Header = () => {
const style = {
      display: "flex",
      padding: "20px",
      color: "black", 
      borderRadius: "8px"
    };

  return (
    

    <Navbar className="d-flex mx-5 ms-10 gap-10">
      <NavbarBrand>Logo</NavbarBrand>
      <Link href="/">
        Home
      </Link>
    </Navbar>
  )
}

export default Header;
